import React, { useState } from 'react';
import { DataTable } from 'primereact/datatable';
import { Column } from 'primereact/column';


export default function Ardupilot() {
  const configs = ['Flight Mode', 'Standard Params', 'Advanced Params', 'Full Parameter List', 'Help'];
  const [selectedConfig, setSelectedConfig] = useState('Flight Mode');
  const [activePage, setActivePage] = useState([configs[0]])


  const renderPage = () => {
    switch (activePage) {
      case 'Flight Page':
        return <Home />;
      case 'Flight':
        return <Flight />;
      case 'Drone Setup':
        return <DroneSetup />
      case 'Ardupilot':
        return <Ardupilot />
      default:
        return <Home />;
    }
  };

  return (
    <div className="h-auto bg-banner-color">
      <div className="bg-black text-white w-1/3 border flex flex-col">
        {
          configs.map((x) => (
            <span
              key={x} // Add a key to prevent React warnings
              onClick={() => setSelectedConfig(x)} // Set the selected configuration
              className={`p-2 cursor-pointer hover:bg-red-400 ${selectedConfig === x ? 'font-bold bg-red-400' : ''}`} // Highlight selected
            >
              {x}
            </span>
          ))
        }
      </div>

      <div>
        {renderPage()}
      </div>




    </div>
  );
}
